import Link from 'next/link';
import React, {Component} from 'react';

export default function LinkButton(props){
    return(
        <button  className = {props.classButton} type="button">                    
            <Link href={props.ref}>
                <a className = {props.classRef}>{props.text}</a>
            </Link>
        </button>
    );
}
